import React, { useEffect, useState } from "react";
import Header from "../component/Header";
import {
  Facebook,
  Google,
  Instagram,
  Linkedin,
  Twitter,
  X,
  Youtube,
} from "react-bootstrap-icons";
import { useLocation, useNavigate } from "react-router-dom";
import emailjs from "@emailjs/browser";
import { toast } from "react-toastify";

function Contacts() {
  const [name, setname] = useState();
  const [email, setemail] = useState();
  const [enquiry, setenquiry] = useState();
  const [message, setmessage] = useState();

  const router = useNavigate();

  const handlesubmit = (e) => {
    e.preventDefault();

    const serviceId = "service_l4cd7ro";
    const templateId = "template_pyxeq6t";
    const publicKey = "gL4z2hKi0PKtkJdXz";

    const templateParams = {
      from_name: name,
      from_email: email,
      from_enquiry: enquiry,
      to_name: "Teampatchwork",
      message: message,
    };

    emailjs
      .send(serviceId, templateId, templateParams, publicKey)
      .then((res) => {})
      .catch((err) => {
        toast.warning("someting error!", {
          position: "top-right",
          autoClose: 5000,
          hideProgressBar: false,
          closeOnClick: true,
          pauseOnHover: true,
          draggable: true,
          progress: undefined,
        });
      });
  };
  const { pathname } = useLocation();

  return (
    <>
      <Header />

      <section>
        <div className="container">
          <div className="work-sect text-center text-white position-relative">
            <h3 data-aos="fade-up">LET'S TALK</h3>
            <div className="hang-came3" data-aos="fade-down">
              <img src="\assets\hangimg.avif" className="img-fluid" />
            </div>
          </div>
          <div className="d-flex justify-content-center ct-top">
            <div className="contact-team">
              <div className="row">
                <div className="col-lg-12 col-md-12 col-sm-12">
                  <div className="ct-box">
                    <p>EMAIL</p>
                    <h4>teampatchwork360@gmail.com</h4>
                  </div>
                </div>
                <div className="col-lg-12 col-md-12 col-sm-12">
                  <div className="ct-box">
                    <p>PHONE</p>
                    <h4>91+893969455</h4>
                  </div>
                </div>
                <div className="col-lg-4 col-md-4 col-4 ">
                  <div className="ct-box">
                    <h3>
                      <Instagram />
                    </h3>
                    <h6>INSTAGRAM</h6>
                  </div>
                  <div className="ct-box">
                    <h3>
                      <Facebook />
                    </h3>
                    <h6>FACEBOOK</h6>
                  </div>
                </div>

                <div className="col-lg-4 col-md-4 col-4">
                  <div className="ct-box">
                    <h3>
                      <Twitter />
                    </h3>
                    <h6>TWITTER</h6>
                  </div>
                  <div className="ct-box">
                    <h3>
                      <Youtube />
                    </h3>
                    <h6>YOUTUBE</h6>
                  </div>
                </div>
                <div className="col-lg-4 col-md-4  col-4">
                  <div className="ct-box">
                    <h3>
                      <Linkedin />
                    </h3>
                    <h6>LINKED IN</h6>
                  </div>
                  <div className="ct-box">
                    <h3>
                      <Google />
                    </h3>
